INSERT INTO `360suites_roomtexto` (`id`, `roomId`, `texto`, `id_hotel`) VALUES
(1, '215348', 'Localizado em São Paulo, a 14 minutos a pé da Sala São Paulo e a 1,4 km do Mercado Municipal de São Paulo, o 360 Suites Downtown Luz oferece acomodações com Wi-Fi gratuito, ar-condicionado, piscina ao ar livre e academia. Em algumas das unidades também há uma cozinha equipada com micro-ondas, geladeira e torradeira. O apartamento oferece um terraço. O Edifício Copan fica a 19 minutos a pé do 360 Suites Downtown Luz, enquanto a Pinacoteca do Estado de São Paulo fica a 1,9 km da propriedade. O aeroporto mais próximo é o Aeroporto de Congonhas, a 11,3 km do alojamento.', '10'),
