(15, '216942', 'Apartamento moderno em prédio novo, completo com academia, piscina e portaria 24 horas. O apartamento  vem equipado com jogo de enxoval completo e toalhas. O quarto é equipado com ar condicionado, uma cama queen size, wifi grátis e smart TV com acesso a Netflix. Temos também uma cozinha compacta com microondas, cafeteira Nespresso, frigobar e sanduicheira. Tem louça e utensílios de cozinha para uma refeição a dois. Prezamos pela limpeza absoluta e um atendimento personalizado.', '12'),
(16, '216943', 'Apartamento moderno em pr&eacute;dio novo, completo com academia, piscina e portaria 24 horas. O apartamento &nbsp;vem equipado com jogo de enxoval completo e toalhas. O quarto &eacute; equipado com ar condicionado, uma cama queen size, wifi gr&aacute;tis e smart TV com acesso a Netflix. Temos tamb&eacute;m uma cozinha compacta com microondas, cafeteira Nespresso, frigobar e sanduicheira. Tem lou&ccedil;a e utens&iacute;lios de cozinha para uma refei&ccedil;&atilde;o a dois. Prezamos pela limpeza absoluta e um atendimento personalizado.', '12'),
(17, '216945', 'Apartamento moderno em prédio novo, completo com academia, piscina e portaria 24 horas. O apartamento  vem equipado com jogo de enxoval completo e toalhas. O quarto é equipado com ar condicionado, uma cama queen size, wifi grátis e smart TV com acesso a Netflix. Temos também uma cozinha compacta com microondas. Tem louça e utensílios de cozinha para uma refeição a dois.', '12'),
(18, '217360', 'Localizado em São Paulo, a 14 minutos a pé da Sala São Paulo e a 1,4 km do Mercado Municipal de São Paulo, o 360 Suites Downtown Luz oferece acomodações com Wi-Fi gratuito, ar-condicionado, piscina ao ar livre e academia. Em algumas das unidades também há uma cozinha equipada com micro-ondas, geladeira e torradeira. O apartamento oferece um terraço. O Edifício Copan fica a 19 minutos a pé do 360 Suites Downtown Luz, enquanto a Pinacoteca do Estado de São Paulo fica a 1,9 km da propriedade. O aeroporto mais próximo é o Aeroporto de Congonhas, a 11,3 km do alojamento.', '10'),
