(33, '261727', 'Desfrute de uma suíte aconchegante, localização privilegiada e uma recepção calorosa!Nossa Suíte:Wi-Fi | Varanda | Ar-condicionado | TV | Roupa de Cama | Toalhas | Produtos de Higiene Pessoal | Secador de Cabelo | Cafeteira | Microondas | Cooktop | Forno.Condomínio:Portaria 24h | Lavanderia | Piscina | Academia | Áreas de lazer | Espaços Externos e muito mais.Ao lado de diversos comércios, meios de transporte, parques, pontos turísticos e edifícios empresariais.', '11'),
(34, '261728', 'Desfrute de uma suíte aconchegante, localização privilegiada e uma recepção calorosa!Nossa Suíte:Wi-Fi | Varanda | Ar-condicionado | TV | Roupa de Cama | Toalhas | Produtos de Higiene Pessoal | Secador de Cabelo | Cafeteira | Microondas | Cooktop | Forno.Condomínio:Portaria 24h | Lavanderia | Piscina | Academia | Áreas de lazer | Espaços Externos e muito mais.Ao lado de diversos comércios, meios de transporte, parques, pontos turísticos e edifícios empresariais.', '11'),
(35, '232214', 'Apartamento privativo em edifício recém inaugurado com lazer completo incluindo piscina externa, academia com equipamento de última geração e sala de reunião. Localizado a apenas alguns passos do metrô. O apartamento vem equipado com ar condicionado, cama de casal queen com enxoval completo e uma cozinha compacta com todos os utensílios necessários para fazer uma pequena refeição. O prédio tem uma piscina com vista maravilhosa da Praça da República e outros marcos do centro de SP.', '14'),
(36, '233789', 'Apartamento de 48m2 completo com academia, piscina e recepção 24 horas. O apartamento vem equipado com jogo de enxoval completo e toalhas. O quarto tem ar condicionado, uma cama de casal e wifi grátis. Temos também uma cozinha compacta com louça e utensílios de cozinha para uma refeição a dois. Prezamos pela limpeza absoluta e um atendimento personalizado. O estacionamento está incluso na estadia. Tem um restaurante no prédio com café da manhã, cobrado a parte no local.', '15'),
(37, '234152', 'Apartamento de 48m2 completo com academia, piscina e recepção 24 horas. O apartamento vem equipado com jogo de enxoval completo e toalhas. O quarto tem ar condicionado, uma cama de casal e wifi grátis. Temos também uma cozinha compacta com louça e utensílios de cozinha para uma refeição a dois. Prezamos pela limpeza absoluta e um atendimento personalizado.<br />O estacionamento está incluso na estadia. Tem um restaurante no prédio com café da manhã, cobrado a parte no local.', '15'),
(38, '259658', 'Apartamento de 48m2 com dois quartos, completo! Com academia, piscina e recepção 24 horas. O apartamento vem equipado com jogo de enxoval completo e toalhas. O quarto tem ar condicionado, uma cama de casal e wifi grátis. Temos também uma cozinha compacta com louça e utensílios de cozinha para uma refeição a dois. Prezamos pela limpeza absoluta e um atendimento personalizado. O estacionamento está incluso na estadia. Tem um restaurante no prédio com café da manhã, cobrado a parte no local.', '15');
